COSTS = {'1': 1, '2': 2, '3': 3, '4': 4, 'S': 0, '0': float('inf')}

class DevanionOptimizer:
    def __init__(self, root):
        self.root = root
        self.root.title("Devanion Optimizer")
        self.root.minsize(600, 600)

        self.current_map_name = list(MAPS.keys())[0]
        self.grid_data = []
        self.rows = 0
        self.cols = 0
        self.start_node = None
        self.targets = set()
        
        self.cell_size = 30
        self.offset_x = 0
        self.offset_y = 0
        self.path_nodes = set()
        
        self.raw_images = {} 
        self.tk_images = {}
        self._load_images()

        self._setup_ui()
        self._load_map(self.current_map_name)

    def _load_images(self):
        for key, b64_str in IMAGE_DATA.items():
            img_data = base64.b64decode(b64_str)
            img = Image.open(io.BytesIO(img_data))
            self.raw_images[key] = img

    def _resize_images(self):
        if not self.raw_images: return
        self.tk_images.clear()
        img_size = int(self.cell_size)
        for key, raw_img in self.raw_images.items():
            resized = raw_img.resize((img_size, img_size), Image.Resampling.LANCZOS)
            self.tk_images[key] = ImageTk.PhotoImage(resized)

    def _setup_ui(self):
        control_frame = tk.Frame(self.root, bg = "#f0f0f0")
        control_frame.pack(side = tk.TOP, fill = tk.X, padx = 10, pady = 10)

        tk.Label(control_frame, text = " :", bg = "#f0f0f0").pack(side = tk.LEFT, padx = 5)
        self.map_combo = ttk.Combobox(control_frame, values = list(MAPS.keys()), state = "readonly", width = 15)
        self.map_combo.current(0)
        self.map_combo.pack(side = tk.LEFT, padx = 5)
        self.map_combo.bind("<<ComboboxSelected>>", self._on_map_change)

        btn_reset = tk.Button(control_frame, text = " ", command = self._reset_selection)
        btn_reset.pack(side = tk.RIGHT, padx = 5)

        self.result_label = tk.Label(self.root, text = "  ", font = (" ", 14, "bold"), fg = "black", bg = "#f0f0f0")
        self.result_label.pack(side = tk.BOTTOM, pady = 10)

        bg_color = "#0C1012"
        self.canvas_frame = tk.Frame(self.root, bg = bg_color)
        self.canvas_frame.pack(fill = tk.BOTH, expand = True, padx = 20, pady = 5)
        self.canvas = tk.Canvas(self.canvas_frame, bg = bg_color, highlightthickness = 0)
        self.canvas.pack(fill = tk.BOTH, expand = True)
        self.canvas.bind("<Button-1>", self._on_canvas_click)
        self.canvas.bind("<Configure>", self._on_resize)

    def _load_map(self, map_name):
        layout = MAPS[map_name]
        self.grid_data = []
        self.targets.clear()
        self.path_nodes.clear()
        self.start_node = None
        self.rows = len(layout)
        self.cols = len(layout[0])
        for r, row_str in enumerate(layout):
            row_data = []
            for c, char in enumerate(row_str):
                row_data.append(char)
                if char == 'S': self.start_node = (r, c)
            self.grid_data.append(row_data)
        if not self.start_node: self.start_node = (self.rows // 2, self.cols // 2)
        
        curr_w = self.canvas.winfo_width()
        curr_h = self.canvas.winfo_height()
        if curr_w > 1 and curr_h > 1: self._update_layout(curr_w, curr_h)
        else: self._draw_grid()

    def _on_map_change(self, event):
        selected_map = self.map_combo.get()
        if selected_map !=  self.current_map_name:
            self.current_map_name = selected_map
            self._load_map(selected_map)
            self.result_label.config(text = "  ", fg = "black", bg = "#f0f0f0", font = (" ", 14, "bold"))

    def _on_resize(self, event):
        self._update_layout(event.width, event.height)

    def _update_layout(self, w, h):
        if self.rows == 0 or self.cols == 0: return
        cell_w = w / self.cols
        cell_h = h / self.rows
        self.cell_size = int(min(cell_w, cell_h) * 0.95)
        if self.cell_size < 10: self.cell_size = 10
        total_w = self.cell_size * self.cols
        total_h = self.cell_size * self.rows
        self.offset_x = (w - total_w) // 2
        self.offset_y = (h - total_h) // 2
        self._resize_images()
        self._draw_grid(self.path_nodes)

    def _reset_selection(self):
        self.targets.clear()
        self.path_nodes.clear()
        self.result_label.config(text = "  ", fg = "black", bg = "#f0f0f0", font = (" ", 14, "bold"))
        self._draw_grid()

    def _draw_grid(self, path_nodes = None):
        self.canvas.delete("all")
        if path_nodes is None:
            path_nodes = set()

        for r in range(self.rows):
            for c in range(self.cols):
                x1 = self.offset_x + c * self.cell_size
                y1 = self.offset_y + r * self.cell_size
                cx, cy = (x1 + self.cell_size/2), (y1 + self.cell_size/2)

                char_code = self.grid_data[r][c]
                
                is_path = (r, c) in path_nodes
                is_target = (r, c) in self.targets

                img_key = char_code
                
                if is_path or is_target:
                    active_key = f"{char_code}_active"
                    if active_key in self.tk_images:
                        img_key = active_key
                
                if img_key in self.tk_images:
                    self.canvas.create_image(cx, cy, image = self.tk_images[img_key])
                    
                    if is_target:
                        highlight_width = max(3, int(self.cell_size * 0.08))
                        self.canvas.create_rectangle(
                            x1 + highlight_width/2, y1 + highlight_width/2, 
                            x1 + self.cell_size - highlight_width/2, y1 + self.cell_size - highlight_width/2,
                            outline = '#FFFACD', width = highlight_width
                        )

    def _on_canvas_click(self, event):
        if self.cell_size == 0: return
        c = int((event.x - self.offset_x) / self.cell_size)
        r = int((event.y - self.offset_y) / self.cell_size)
        if not (0 <= r < self.rows and 0 <= c < self.cols): return
        node_type = self.grid_data[r][c]
        if node_type == '0' or node_type == 'S': return

        if (r, c) in self.targets:
            self.targets.remove((r, c))
        else:
            self.targets.add((r, c))
        
        self._optimization()

    def _calculate_path_cost(self, priority_target=None):
        activated = set([self.start_node])
        total_cost = 0
        remaining_targets = list(self.targets)
        full_path_nodes = set([self.start_node])

        if priority_target:
            cost, path, reached = self._dijkstra(activated, [priority_target])
            if not reached: return float('inf'), set()
            
            total_cost += cost
            remaining_targets.remove(priority_target)
            for node in path:
                if node not in activated: activated.add(node)
                full_path_nodes.add(node)

        while remaining_targets:
            cost, path, target = self._dijkstra(activated, remaining_targets)
            if not target: return float('inf'), set()

            remaining_targets.remove(target)
            total_cost += cost
            for node in path:
                if node not in activated: activated.add(node)
                full_path_nodes.add(node)
        
        return total_cost, full_path_nodes

    def _optimization(self):
        if not self.targets:
            self.path_nodes.clear()
            self._draw_grid()
            self.result_label.config(text=f"  ", fg="black", bg="#f0f0f0", font=(" ", 14, "bold"))
            return

        ITERATIONS = 50 
        best_total_cost = float('inf')
        best_path_set = set()

        targets_list = list(self.targets)
        
        for start_target in targets_list:
            path = self._run_simulation(targets_list, first_target=start_target)
            refined_path = self._refine_path(path)
            cost = self._calculate_final_cost(refined_path)
            
            if cost < best_total_cost:
                best_total_cost = cost
                best_path_set = refined_path

        for _ in range(ITERATIONS):
            shuffled_targets = list(self.targets)
            random.shuffle(shuffled_targets)
            path = self._run_simulation(shuffled_targets, first_target=None)
            
            refined_path = self._refine_path(path)
            cost = self._calculate_final_cost(refined_path)
            
            if cost < best_total_cost:
                best_total_cost = cost
                best_path_set = refined_path

        if best_total_cost == float('inf'):
            messagebox.showerror("", "   .")
            return

        self.path_nodes = best_path_set
        self._draw_grid(best_path_set)
        self.result_label.config(text=f"[{self.current_map_name}]  : {best_total_cost}", fg="black", bg="#f0f0f0", font=(" ", 14, "bold"))

    def _refine_path(self, path_set):
        if not path_set: return set()
        
        terminals = self.targets.union({self.start_node})
        
        candidates = list(path_set - terminals)
        
        candidates.sort(key=lambda pos: COSTS.get(self.grid_data[pos[0]][pos[1]], 0), reverse=True)
        
        current_path = path_set.copy()
        
        for node in candidates:
            current_path.remove(node)
            
            if not self._check_connectivity(current_path, terminals):
                current_path.add(node)
                
        return current_path

    def _check_connectivity(self, path_set, terminals):
        if not terminals.issubset(path_set): return False
        
        q = [self.start_node]
        visited = {self.start_node}
        count_terminals = 1 if self.start_node in terminals else 0
        
        while q:
            r, c = q.pop(0)
            
            for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                nr, nc = r + dr, c + dc
                if (nr, nc) in path_set and (nr, nc) not in visited:
                    visited.add((nr, nc))
                    q.append((nr, nc))
                    if (nr, nc) in terminals:
                        count_terminals += 1
        
        return count_terminals == len(terminals)

    def _calculate_final_cost(self, path_set):
        cost = 0
        for (r, c) in path_set:
            if (r, c) == self.start_node: continue
            n_type = self.grid_data[r][c]
            cost += COSTS.get(n_type, 0)
        return cost

    def _run_simulation(self, target_order_list, first_target=None):
        activated = set([self.start_node])
        remaining = target_order_list[:]

        if first_target and first_target in remaining:
            remaining.remove(first_target)
            remaining.insert(0, first_target)
        
        while remaining:
            reached_targets = [t for t in remaining if t in activated]
            for t in reached_targets: remaining.remove(t)
            
            if not remaining: break

            _, path, target = self._dijkstra(activated, remaining)
            if not target: return set() 

            remaining.remove(target)
            for node in path:
                activated.add(node)
        
        return activated

    def _dijkstra(self, starts, targets):
        pq = []
        visited = set()
        for node in starts:
            heapq.heappush(pq, (0, node[0], node[1], []))
            visited.add(node)
        while pq:
            cost, r, c, path = heapq.heappop(pq)
            if (r, c) in targets: return cost, path, (r, c)
            for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                nr, nc = r + dr, c + dc
                if 0 <= nr < self.rows and 0 <= nc < self.cols:
                    if (nr, nc) not in visited:
                        n_type = self.grid_data[nr][nc]
                        if n_type != '0': 
                            weight = 0 if (nr, nc) in starts else COSTS.get(n_type, 99)
                            visited.add((nr, nc))
                            heapq.heappush(pq, (cost + weight, nr, nc, path + [(nr, nc)]))
        return 0, [], None
    
if __name__ == "__main__":
    root = tk.Tk()
    app = DevanionOptimizer(root)
    root.mainloop()